import React from "react";
import { Container, Row, Col, FormGroup } from "react-bootstrap";

import UserPhoto from "../UserPhoto";
import UserDirectionInfo from "../UserDirectionInfo";

const UserProfile = () => {
  return (
    <Container>
      <Row className="justify-content-md-center">
        <Col>
          <div
            style={{
              fontFamily: "GothamBold",
              display: "flex",
              alignItems: "center",
              justifyContent: "space-evenly",
              padding: "15px 0",
            }}
          >
            <UserPhoto />
            <div>
              <h3
                tyle={{
                  fontFamily: "GothamBold",
                  fontSize: "13px",
                }}
              >
                Fernando Garcia
              </h3>
              <a
                href
                style={{
                  fontFamily: "GothamBook",
                  fontSize: "13px",

                  display: "flex",
                  justifyContent: "space-evenly",
                  padding: "0",
                }}
              >
                Editar perfil
              </a>
            </div>
          </div>
        </Col>
        <div
          style={{
            fontFamily: "GothamBook",
            fontSize: "13px",
            backgroundColor: "#F3F4F6",
            width: "100%",
            padding: "10px 0 0 25px",
            margin: " 30px 0",
          }}
        >
          <h4>Direcciones</h4>
        </div>
        <UserDirectionInfo />
      </Row>
    </Container>
  );
};

export default UserProfile;
